import React from 'react'; // Import the Component component from React
import ProjectCarousel from './projectPage/projectCarousel.js'
import {Link} from 'react-router-dom'; // Import the Link component
import '../css/App.css';
import HomepageProject from './homepageProject.js'

const project_total = "03"

function Home(props) {

  return (
    <ProjectCarousel
      jsx={[<HomepageProject
       projectKey={'panaseer'}
       key="01"
       number="01"
       total={project_total}
       colour="#0FFFB0"
      />,
      <HomepageProject
       projectKey={'joyStory'}
       key="02"
       number="02"
       total={project_total}
       colour="#FF491C"
      />,
      <HomepageProject
       projectKey={'spiro'}
       key="03"
       number="03"
       total={project_total}
       colour="#FFEE1C"
      />
      ]}
    />
  );
}

export default Home;
